import React from 'react';
import {BrowserRouter as Router, Route, Routes} from 'react-router-dom';
import Login from './components/auth/Login';
import Register from './components/auth/Register.js';
import Paymentpage from './components/Paymentpage.js';
import Navbar from './components/navbar.js';
import GetCustomer from './components/customer/GetCustomer.js';
import UpdateCustomer from './components/customer/UpdateCustomer.js';
import DeleteCustomer from './components/customer/DeleteCustomer.js';
import './App.css';

function App() {
  return (
    <Router>
      <div className='App'>
        <Navbar/>
        <Routes>
          <Route path="/" element={<Login/>}/>
          <Route path="/register" element={<Register/>}/>
          <Route path="/login" element={<Login/>}/>
          <Route path="/customers" element={<GetCustomer/>}/>
          <Route path="/update/:id" element={<UpdateCustomer/>}/>
          <Route path="/delete/:id" element={<DeleteCustomer/>}/>
          <Route path="/payment" element={<Paymentpage/>}/>
        </Routes>
      </div>
    </Router>
  );
}

export default App;
